import React from "react";
import FoodCard from "./FoodCard";
import FoodMenu from "./FoodMenu";
import Discount from './Discount';
import Container from 'react-bootstrap/Container'

const MenuWrapper = () => {
  return (
    <C>
      
      <div><FoodMenu /></div>
      <div><FoodCard /></div>
      <div><Discount/></div> 
    </C>
  );
};
export default MenuWrapper;
